    public function actionChat6() {
        $inputFileName = $this->getPath() . "/models/excel/sku-price-adjust.xls";
        $outfile = $this->getPath() . '/models/sql/sku-price-adjust.json';
        try {
            $spreadsheet = IOFactory::load($inputFileName);
            $sql = '[';
            file_put_contents($outfile, $sql);
            $spreadsheet->setActiveSheetIndex(0);
            $sheetData = $spreadsheet->getActiveSheet()->toArray();
            foreach ($sheetData as $k => $datum) {
                if ($k == 0) {
                    continue;
                }
                $skuInfo = [
                    'sku_id' => trim($datum[0]),
                    'price' => trim($datum[1]) . '.00'
                ];
                $sql = json_encode($skuInfo);
                if (count($sheetData) != $k+1) {
                    $sql .= ',';
                }
                file_put_contents($outfile, $sql, FILE_APPEND);
            }
            file_put_contents($outfile, ']', FILE_APPEND);

        }
        catch (\Exception $e) {
            return $e->getMessage();
        }
        return $this->success(['result' => '成功']);
    }

    public function actionChat5() {
        $inputFileName = $this->getPath() . "/models/excel/b-sku-offline.xlsx";
        $outfile = $this->getPath() . '/models/sql/b-sku-offline.sql';
        try {
            $spreadsheet = IOFactory::load($inputFileName);
            $sql = "
create temporary table tmp__product_sku__id
as
select '' as product_sku_id
from product_sku as a
where 1 = 2\n";
            file_put_contents($outfile, $sql);
            $spreadsheet->setActiveSheetIndex(0);
            $sheetData = $spreadsheet->getActiveSheet()->toArray();
            foreach ($sheetData as $k => $datum) {
                if ($k == 0) {
                    continue;
                }
                $sql = "union select {$datum[0]} \n";
                file_put_contents($outfile, $sql, FILE_APPEND);
            }
            file_put_contents($outfile, ';', FILE_APPEND);

        }
        catch (\Exception $e) {
            return $e->getMessage();
        }

        return $this->success(['result' => '成功']);
    }

    public function actionChat3() {
        $inputFileName = $this->getPath() . "/models/excel/product-need-offline.xlsx";
        $outfile = $this->getPath() . '/models/sql/product-need-offline.sql';

        try {
            $spreadsheet = IOFactory::load($inputFileName);
            $productIds = [];
            $spreadsheet->setActiveSheetIndex(0);
            $sheetData = $spreadsheet->getActiveSheet()->toArray();
            foreach ($sheetData as $k => $datum) {
                if ($k == 0) {
                    continue;
                }
                if ($k >= 1663) {
                    break;
                }
                $productIds[] = $datum[0];
            }
            $newProducts = array_values(array_unique($productIds));

            $sql = "
create temporary table tmp__product__id
as
select '' as product_id
from product as a
where 1 = 2\n";
            file_put_contents($outfile, $sql);
            foreach ($newProducts as $productId) {
                $sql = "union select '{$productId}'\n";
                file_put_contents($outfile, $sql, FILE_APPEND);
            }
            file_put_contents($outfile, ';', FILE_APPEND);
        }
        catch (\Exception $e) {
            return $e->getMessage();
        }

        return $this->success(['result' => '成功']);
    }


    public function getHttpResponsePut($url, $data, $token) {
        $headers = [
            "Content-Type: application/json",
            "admin-token: $token",
        ];
        $ch = curl_init($url);
        curl_setopt($ch, CURLOPT_POSTFIELDS, json_encode($data));
        curl_setopt($ch, CURLOPT_URL, $url);
        curl_setopt($ch, CURLOPT_POST, true);
        curl_setopt($ch, CURLOPT_CUSTOMREQUEST, 'PUT'); //设置请求方式
        curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, false);
        curl_setopt($ch, CURLOPT_HEADER, false);
        curl_setopt($ch, CURLOPT_HTTPHEADER, $headers);
        curl_setopt($ch, CURLOPT_TIMEOUT, 600);
        curl_setopt($ch, CURLOPT_DNS_USE_GLOBAL_CACHE, false);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
        $responseText = curl_exec($ch);

        curl_close($ch);
        return $responseText;
    }
    // 批量下载商品图片
    public function actionChat() {

        $fileList = $this->getData();
        $counter = [];

        foreach ($fileList as $fileInfo) {

            $brand = $fileInfo[0];
            $spuName = $fileInfo[1];
            $spuId = $fileInfo[2];
            $url = $fileInfo[3];

            $key = $brand . '-' . $spuId;
            if (array_key_exists($key, $counter)) {
                $counter[$key] = $counter[$key] + 1;
            } else {
                $counter[$key] = 1;
            }
            //$filePath = 'derek-temp/' . $brand . '/' . $spuName . '-' . $spuId;
            $filePath = 'derek-temp/' . $brand. '/' . $spuName;

            $this->createDir($filePath);
            //$filename = $filePath . '/' . $spuName . '-' . $counter[$key] . '.jpg';//文件名称生成
            $filename = $filePath . '/' . $spuId . '.jpg';//文件名称生成
            try {

                if (!file_exists($filename)) {
                    $this->createFile($filename, $url);
                }
            } catch (\Exception $exception) {
                echo $exception->getMessage();
            }
        }
        echo "all done \n";
    }

    public function createFile($fileName, $url) {
        ob_start();//打开缓冲区
        readfile($url);//输出图片文件到缓冲区
        $img = ob_get_contents();//得到浏览器输出
        ob_end_clean();//清除输出并关闭

        $fp = @fopen($fileName, "a");
        fwrite($fp, $img);//向当前目录写入图片文件，并重新命名
        fclose($fp);
        echo "写入成功:" . $fileName . "\n";
    }

